import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import "./DogRunReviewList.css";
import "./Modal.css";
import Modal from "./Modal";

type Review = {
  id: number;
  name: string;
  store_id: number;
  rating: number;
  comment: string;
  date: string;
  created_at: string;
  updated_at: string;
};

const ReviewList: React.FC = () => {
  const { storeId } = useParams<{ storeId: string }>();
  const [reviews, setReviews] = useState<Review[]>([]);
  const [error, setError] = useState<string | null>(null);
  const [showModal, setShowModal] = useState(false);
  const [selectedRating, setSelectedRating] = useState<number>(0);
  const [averageRating, setAverageRating] = useState<number>(0);
  const [storeName, setStoreName] = useState<string>("");

  useEffect(() => {
    const fetchReviews = async () => {
      try {
        const response = await fetch(`http://localhost:5003/reviews/${storeId}`);
        const data = await response.json();

        // 明示的に created_at で降順ソート
        const storedData = data.sort(
          (a: Review, b: Review) => new Date(b.created_at).getTime() - new Date(a.created_at).getTime()
        );

        // 平均評価を計算
        const avgRating = storedData.length
          ? storedData.reduce((sum: number, review: Review) => sum + review.rating, 0) /
            storedData.length
          : 0;

        setReviews(storedData);
        setAverageRating(avgRating);
      } catch (error) {
        console.error("口コミの取得に失敗しました:", error);
        setError("口コミの取得に失敗しました");
      }
    };

    const fetchStoreName = async () => {
      try {
        const response = await fetch(`http://localhost:5003/stores/${storeId}`);
        const data = await response.json();
        setStoreName(data.name);
      } catch (error) {
        console.error("店舗情報の取得に失敗しました:", error);
        setError("店舗情報の取得に失敗しました");
      }
    };

    fetchReviews();
    fetchStoreName();
  }, [storeId]);

  const handleReviewSubmit = async (rating: number, comment: string) => {
    try {
      console.log("storeId:", storeId);

      const response = await fetch("http://localhost:5003/reviews", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          store_id: storeId,
          rating,
          comment,
        }),
      });

      if (!response.ok) {
        throw new Error("コメント投稿に失敗しました");
      }
      const createdReview = (await response.json()) as Review;

      // 更新されたレビューと平均評価を再計算
      const updatedReviews = [createdReview, ...reviews];
      setReviews(updatedReviews);
      const avgRating = updatedReviews.reduce((sum, review) => sum + review.rating, 0) / updatedReviews.length;
      setAverageRating(avgRating);

      setError(null);
      setShowModal(false);
    } catch (error) {
      console.error("コメント投稿に失敗しました:", error);
      setError("コメント投稿に失敗しました");
    }
  };

  return (
    <div className="review-container">
      {/* 店舗名を表示 */}
      <h1 className="store-name">{storeName}</h1>

      {/* 平均評価を表示 */}
      <div className="average-rating">
        {[1, 2, 3, 4, 5].map((value) => (
          <span
            key={value}
            className={`star ${value <= Math.round(averageRating) ? "selected" : ""}`}
          >
            ★
          </span>
        ))}
        <span className="average-rating-value">{averageRating.toFixed(1)}</span>
      </div>

      <h2 className="review-title">口コミ一覧</h2>
      <button onClick={() => setShowModal(true)} style={{ marginTop: "20px" }}>
        投稿
      </button>
      {error && <p style={{ color: "red" }}>{error}</p>}
      {reviews.map((review) => (
        <div key={review.id} className="review-card">
          <p className="review-rating">
            <strong>評価:</strong> {review.rating}
          </p>
          <p className="review-comment">
            <strong>口コミ:</strong> {review.comment}
          </p>
        </div>
      ))}
      {showModal && (
        <Modal
          show={showModal}
          onClose={() => setShowModal(false)}
          onSubmit={(rating: number, comment: string) => handleReviewSubmit(rating, comment)}
          storeName={storeName}
        />
      )}
    </div>
  );
};

export default ReviewList;
